import React from "react";
import '../App.css';
import './ProjectSection.css'

function ProjectSections(props) {
    return (
        <div className='project-card'>
            <h3>{ props.title }</h3>
            <h5 className=".same-line {
    display: inline;
    overflow: auto;
}">{ props.dates }</h5>
            <p>{ props.body }</p>
        </div>
    );
}
export default ProjectSections;
